/*Table structure for table `siswa` */

DROP TABLE IF EXISTS `siswa`;

CREATE TABLE `siswa` (
  `nis` varchar(20) NOT NULL,
  `nisn` varchar(20) DEFAULT NULL,
  `nama_siswa` varchar(50) DEFAULT NULL,
  `jk_siswa` char(1) DEFAULT NULL,
  `tmpt_lhr_siswa` varchar(50) DEFAULT NULL,
  `tgl_lhr_siswa` date DEFAULT NULL,
  `agama_siswa` varchar(20) DEFAULT 'islam',
  `anak_ke_siswa` tinyint(2) DEFAULT NULL,
  `status_keluarga_siswa` varchar(20) DEFAULT NULL,
  `alamat_siswa` text,
  `telp_siswa` varchar(20) DEFAULT NULL,
  `diterima_grade_siswa` varchar(4) DEFAULT NULL,
  `diterima_tgl_siswa` date DEFAULT NULL,
  `asal_sekolah_siswa` varchar(50) DEFAULT NULL,
  `tahun_ijazah_siswa` year(4) DEFAULT NULL,
  `nomor_ijazah_siswa` varchar(20) DEFAULT NULL,
  `id_sekolah` int(11) DEFAULT NULL,
  `status_belajar` enum('aktif','tidak aktif') DEFAULT 'aktif',
  `created_at` datetime DEFAULT NULL,
  `update_at` datetime DEFAULT NULL,
  PRIMARY KEY (`nis`),
  UNIQUE KEY `nomor_ijazah_siswa` (`nomor_ijazah_siswa`),
  KEY `id_sekolah` (`id_sekolah`),
  CONSTRAINT `siswa_ibfk_1` FOREIGN KEY (`id_sekolah`) REFERENCES `sekolah` (`id_sekolah`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

